contract MessageMeNFT is Ownable, ERC721, ERC721Enumerable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    string internal constant svgStart = '<svg xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMinYMin meet" viewBox="0 0 400 400" width="800" height="800"><defs><linearGradient id="grad" x1="0" x2="0" y1="0" y2="1"><stop offset="0%" stop-color="dimgrey"/><stop offset="10%" stop-color="black"/></linearGradient><radialGradient id="grad2" cx="0.5" cy="0.9" r="1.2" fx="0.5" fy="0.9" spreadMethod="repeat"><stop offset="0%" stop-color="red"/><stop offset="100%" stop-color="blue"/></radialGradient></defs><style>.base { fill:yellow;font-family: monospace; font-size: 15px; }</style><rect y="8" width="100%" height="100%" fill="url(#grad)"/><text x="20" y="30" class="base">';
    string internal constant svgEnd = '<rect width="100%" height="100%" fill="none" stroke="dimgrey" stroke-width="20"/><circle cx="20" cy="395" r="3" fill="limegreen"/></svg>';
    string internal constant desc = '", "description": "LedgerMe is a public ledger for wallet to wallet communications.  Use with care.",';
    string internal constant jsonstart = 'data:application/json;base64,';
    string internal constant jsonStub = '"image": "data:image/svg+xml;base64,';

    struct LedgerData {
        bool claimed;

        bool isPayable;
        uint256 writePrice;

        bool writeActive;

        string header;
        // each person can store 1 message to any other
        mapping(address => string) messages;
        // only last 10 messages are cached for tokenURI, but all can be retrieved
        address[10] lastMessages;
        // current index of the last 10 messages to write to.  this will be the starting point to count back from when getting our messages
        uint writeIndex;
    }
    
    // Counters.counter private _tokenIds;
    mapping(address => LedgerData) public allLedgers;
    // this is used pretty exclusively for tokenuri.  i think its conceptually better to send messages to addresses than to tokenIDs
    mapping(uint => address) public tokensToAddress;

    mapping(address => uint256) public ethValues;

    constructor() ERC721("MessageMe", "MSG") {}

    // edit functions
    function writeFree(address userAddress, string calldata message) external {
        require(!allLedgers[userAddress].isPayable, "token write not free");
        allLedgers[userAddress].messages[_msgSender()] = message;
        allLedgers[userAddress].lastMessages[allLedgers[userAddress].writeIndex] = _msgSender();
        allLedgers[userAddress].writeIndex++;
        // if greater than our array, set back to zero
        if (allLedgers[userAddress].writeIndex > 9) {
            allLedgers[userAddress].writeIndex = 0;
        }
    }

    function writePayable(address userAddress, string calldata message) external payable {
        require(msg.value >= allLedgers[userAddress].writePrice, "not enough, chump");
        allLedgers[userAddress].messages[_msgSender()] = message;
        allLedgers[userAddress].lastMessages[allLedgers[userAddress].writeIndex] = _msgSender();
        allLedgers[userAddress].writeIndex++;
        // if greater than our array, set back to zero
        if (allLedgers[userAddress].writeIndex > 9) {
            allLedgers[userAddress].writeIndex = 0;
        }

        ethValues[userAddress] += msg.value;
    }

    function withdraw(address payable wallet) external {
        require(_msgSender() == wallet, "not yours");
        require(ethValues[_msgSender()] > 0, "need eth to withdraw");

        wallet.transfer(ethValues[_msgSender()]);
        ethValues[_msgSender()] = 0;
    }

    // owner functions
    function setWritePrice(uint256 writePrice) external {
        allLedgers[_msgSender()].isPayable = true;
        allLedgers[_msgSender()].writePrice = writePrice;
    }

    function removeWritePrice() external {
        allLedgers[_msgSender()].isPayable = false;
    }

    // erc721 functions
    function claimToken() external {
        require(allLedgers[_msgSender()].claimed == false, "already claimed");
        _tokenIds.increment();
        uint256 tokenId = _tokenIds.current();
        tokensToAddress[tokenId] = _msgSender();
        allLedgers[_msgSender()].claimed = true;
        allLedgers[_msgSender()].writeActive = true;
        allLedgers[_msgSender()].isPayable = false;
        allLedgers[_msgSender()].header = "its nice to see you";
        allLedgers[_msgSender()].writeIndex = 0;

        _safeMint(_msgSender(), tokenId);
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {   
        address[10] memory msgsCopy = allLedgers[tokensToAddress[tokenId]].lastMessages;     
        string memory output = string(abi.encodePacked(
            svgStart,
            allLedgers[tokensToAddress[tokenId]].header,
            '</text>'
            ));

        uint textOffset = 0;
        for (uint i = 0; i < 10; i++) {
            uint offset = 50 + (i * 20);
            textOffset++;
            output = string(abi.encodePacked(output, '<text x="20" y="', Strings.toString(offset), '" class="base">', allLedgers[tokensToAddress[tokenId]].messages[msgsCopy[i]], '</text>'));
        }
        output = string(abi.encodePacked(
            output,
            svgEnd));
        string memory json = Base64.encode(bytes(string(abi.encodePacked(
            '{"name": "Message #', 
            Strings.toString(tokenId), 
            desc, 
            jsonStub, 
            Base64.encode(bytes(output)), '"}'))));
        output = string(abi.encodePacked(jsonstart, json));
        return output;
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override(ERC721, ERC721Enumerable) {
        ERC721Enumerable._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

